    //       </ul>
    //     </div>
    //   </div>
    // </nav>
    <nav style="background-color: green;" className="navbar navbar-expand-lg navbar-light bg-light p-0">
        <Button className="navbar-toggler" type="Button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
        </Button>
        <div className="collapse navbar-collapse" width="100%" id="navbarNav">
            <ul className="navbar-nav" style="height: 4rem;">
                <li className="nav-item">
                    <a className="nav-link p-3" href="/">Home</a>
                </li>
                
                <li className="nav-item">
                    <a className="nav-link p-3" href="{% url 'view friends' %}">Friends</a>
                </li>
                <li className="nav-item">
                    <a className="nav-link p-3" href="{% url 'settings' %}">Settings</a>
                </li>
            </ul>
        </div>
        <a className="nav-item mr-3 nav-link p-3" href="{% url 'logout' %}" style="background-color: #e85c29">Logout</a>
    </nav>
  );
}

Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  abouttext: PropTypes.string.isRequired,
};

Navbar.defaultProps = { title: "set title here", abouttext: "About" };
